import { Icon } from "antd";
import styled from "styled-components";
import Link from "next/link";
const NavlinkWrapper = styled.div``;

const Navlinks = () => (
	<NavlinkWrapper>
		<Link to="/">
			<Icon type="home" />
		</Link>
	</NavlinkWrapper>
);
export default Navlinks;
